package com.yb.test;

import com.yb.util.AESUtils;

import java.security.NoSuchAlgorithmException;

public class TestAES {
    public static void main(String[] args) throws NoSuchAlgorithmException {
        byte[] encrypt = AESUtils.encrypt("{\"code\":0,\"data\":\"\"}\n" +
                "data========D6899EA2D20FAB167E2843EB1D4E57C421D256ADBA2C9D4FB5B6D17A891C6A3ACCCDB148C7888C9921C740419E4F0905D3ED39A92683F12BA", "bjshell");
        System.out.println("密码"+new String(encrypt));
        byte[] bjshells = AESUtils.decrypt(encrypt, "bjshell");
        System.out.println(new String(bjshells));
    }
    /**将16进制转换为二进制
     * @param hexStr
     * @return
     */
    public static byte[] parseHexStr2Byte(String hexStr) {
        if (hexStr.length() < 1)
            return null;
        byte[] result = new byte[hexStr.length()/2];
        for (int i = 0;i< hexStr.length()/2; i++) {
            int high = Integer.parseInt(hexStr.substring(i*2, i*2+1), 16);
            int low = Integer.parseInt(hexStr.substring(i*2+1, i*2+2), 16);
            result[i] = (byte) (high * 16 + low);
        }
        return result;
    }
    /**将二进制转换成16进制
     * @param buf
     * @return
     */
    public static String parseByte2HexStr(byte buf[]) {
        StringBuffer sb = new StringBuffer();
        for (int i = 0; i < buf.length; i++) {
            String hex = Integer.toHexString(buf[i] & 0xFF);
            if (hex.length() == 1) {
                hex = '0' + hex;
            }
            sb.append(hex.toUpperCase());
        }
        return sb.toString();
    }
}
